<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Pixel Rain Example</title>
</head>
<style>
    body {
        background: black;
    }
    #myCanvas {
        
        padding-top: 100px;
        padding-left: 0;
        padding-right: 0;
        margin-left: auto;
        margin-right: auto;
        display: block;
    }
</style>
<body>
    <div>
        <canvas id='myCanvas'></canvas>
    </div>
    
    <!-- <p>Images may have cross-browser issues with this effect.  Therefore, it is recommended that you import your images as Base64.  Also, the image may need to be as small as 400x400 for performance issues.</p> -->
</body>
<script src="../source/pixel_rain.js"></script>
<script>

    /**
     *  Can be imported as a script in the HTML document just as this example demonstrates.
     *  just call pixelRain()
     *  Or can be imported as a moduel:
     *     import { yourNameHere } from '...'
     * */

    function main() {
        const myCanvas = document.getElementById('myCanvas')
        const myImage = new Image()
        myImage.src = `data:image/png;base64, ${imageBase64}`
        myCanvas.height = myImage.height
        myCanvas.width = myImage.width
        pixelRain(myCanvas, myImage, 1.5, 20000, 3, 100)
    }
